"""#Broadcast"""

rdd = sc.parallelize(item for item in range(10))

uno = 1

br_uno = sc.broadcast(uno)

rdd1 = rdd.map(lambda x:x+br_uno.value)
rdd1.collect()

br_uno.unpersist()

rdd1 = rdd.map(lambda x:x+br_uno.value)
rdd1.collect()

br_uno.destroy()

#como se destruye la variable broadcast br_uno no se puede obtener lo solicitidato en el caso con take los primeros 5 valores
